import React from 'react';
import './Header.css';
import {Link} from 'react-router-dom';


const renderedLinks = () => {
  return (
    <div className="LinkGrid">
      <a href={'/'}>Home</a>
      <a href={'/about'}>About</a>
      <a href={'/gallery'}>Gallery</a>
    </div>
  )
}

const Header = () => {
  return (
    <div className="Header">
        <div className="TopText">
          <p><a href="call">602-944-5210 </a>| <a href="address">10032 N Cave Creek Rd
Phoenix, AZ 85020</a></p>
        </div>
      <div className="Grid">
        <div className="Logo">
          <a href={'/'}>
              <img src="logo.png"></img>
          </a>
        </div>
        <nav className="NavLinks">{renderedLinks()}</nav>
        <div className="ActionButton"><button>CALL NOW</button></div>
      </div>
    </div>
  );
}

export default Header;
